    @rtransform :ADTM = parse_datetime_column(:PCDTC)
    @rtransform :ADT = isnothing(:ADTM) || ismissing(:ADTM) ? missing : Date(:ADTM)
    @rtransform :ATM = isnothing(:ADTM) || ismissing(:ADTM) ? missing : Time(:ADTM)


    @rtransform begin
        :EVID = 0
        :DRUG = :PCTEST
        :NFRLT = :VISITDY == 1 ? 0 : 24 * :VISITDY 
    end
end
